from typing import List

class Solution:
    def maximumNumberOfStringPairs(self, words: List[str]) -> int:
        word_count = 0
        word_set = set(words)
        for word in words:
            if word[::-1] in word_set:
                word_count += 1
                word_set.remove(word)
                word_set.remove(word[::-1])
        return word_count // 2
